import { Injectable } from '@angular/core';
import * as moment from 'moment';
import { of } from 'rxjs';
import { INewsFeed } from '../models/news-feed.model';
import { IUserFeedService } from '../models/user-feed.service.model';
import { IUser } from '../models/user.model';

@Injectable({
  providedIn: 'root',
})
export class MockNewsFeedService implements IUserFeedService {
  loadFeedsOfSelectedUser(users: string[], offset = 0, limit = 5) {
    if (!users?.length) return of({ count: 0, data: [] });

    const newsFeeds = mockData
      .filter((user: IUser) => users.includes(user.username))
      .sort((a, b) => {
        if (moment(a.date).isAfter(moment(b.date))) return -1;
      });
    return of({
      count: newsFeeds.length,
      data: newsFeeds.slice(offset, limit),
    });
  }
}

